  [],\n\t\"revision_timestamp\": \"2015-07-08T19:13:50.333842\",\n\t\"name\": \"gpm-ground-validation-noaa-s-band-profiler-original-dwell-data-mc3e-v1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The S-band Profiler Original Dwell dataset
  in the netCDF format was gathered during the Midlatitude Continental Convective
  Clouds Experiment (MC3E) in Oklahoma April-June 2011.  The S-band profiler operates
  at 2.8 GHz, points vertically, and measures the backscattered power from raindrops
  and ice particles as precipitating cloud systems pass overhead.  The S-band operated
  in two modes: precipitation mode and attenuated mode.  The precipitation mode was
  the normal or full-power mode, and the attenuated mode was the low-power mode.  The
  profiler alternated between modes collecting either 7 or 9 consecutive precipitation
  mode profiles separated by 1 attenuated mode profile.  Both modes processed radar
  pulses collected during a 7-second dwell before calculating the Doppler velocity
  spectra at each radar range gate that were separated by 60-meters in the vertical.
  \ The attenuated and precipitation mode data are available in moment, pop spectra
  (uncalibrated raw spectra) and calibrated spectra hourly files.  The S-band spectra
  were calibrated against the surface disdrometer to determine a radar calibration
  constant.  Calibrated spectra were constructed for each profile and are expressed
  as reflectivity spectral density.  After calibration, the instrument provides a
  reflectivity estimate through the precipitation.  Data is in hourly files in the
  netCDF format.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
